import react from "react";
import MainScreen from "./MainScreen";
import Card from 'react-bootstrap/Card';
import Button from 'react-bootstrap/Button';
import notes from "../Data/notes.js";
import "./MyNotes.css";


function MyNotes(){

    function child1(){

        const variant = "Warning";

        return (
<div>
            <div className = "newNote" style={{marginLeft: 10}}>
            <Button style={{marginLeft: 10}} variant="success"> Create New Note</Button> 
            </div>

        <div className = "rows">
            {(notes).map((note) => (

                        <Card
                        bg={variant.toLowerCase()}
                        key={variant} 
                        /* text={variant.toLowerCase() === 'light' ? 'dark' : 'white'} */
                        style={{ width: '18rem' }}
                        className="mb-2"
                    >
                        <Card.Header>{"Note: "}{note._id}</Card.Header>
                        <Card.Body>
                        <Card.Title> {note.title} </Card.Title>
                        <Card.Text>
                            {note.content}
                        </Card.Text>
                        <Button variant="outline-primary" > {"Edit"}</Button>
                        <Button variant="outline-danger" > {"Delete"}</Button>
                        </Card.Body>
                    </Card>)


                )}
                </div>

</div>


        );
    };



    return(
    <MainScreen title = "Welcome back Miles" child = {child1()} > My Notes </MainScreen> 
    );

}

export default MyNotes
